Desc:
Christy (Gracie Glam) is new at school... She is smart, pretty, popular, and accustomed to using sex to get her way. Soon the handsome chemistry professor becomes the object of her desire. When the sentiment is not returned however, Christy's true colors begin to show. Even her roommate (Ash Hollywood) and her friend (Alektra Blue) begin to suspect something sinister. When students begin having &quot;accidents&quot;, it becomes clear that Christy will stop at nothing to get what she wants.
